define('text!views/details.html',[],function () { return '<section>\r\n    <h2 class="page-title" data-bind="text: title"></h2>\r\n</section>';});


define('text!views/faq.html',[],function () { return '<section>\r\n    <h2 class="page-title" data-bind="text: title"></h2>\r\n    <div class="accordion" id="accordion2">\r\n        <div class="accordion-group">\r\n            <div class="accordion-heading">\r\n                <a class="accordion-toggle" data-toggle="collapse" data-parent="#accordion2" href="#collapseWhat">What is this?\r\n                </a>\r\n            </div>\r\n            <div id="collapseWhat" class="accordion-body collapse in">\r\n                <div class="accordion-inner">\r\n                    This is a simple web site that is meant to compare different bikes in a simple and visual way.\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div class="accordion-group">\r\n            <div class="accordion-heading">\r\n                <a class="accordion-toggle" data-toggle="collapse" data-parent="#accordion2" href="#collapseWhere">Where did the data come from?\r\n                </a>\r\n            </div>\r\n            <div id="collapseWhere" class="accordion-body collapse">\r\n                <div class="accordion-inner">\r\n                    Up to now the data has come primarily from the manufacturers web sites.  If there are inconsistencies in the data it is because I had to calculate the data from other measurements provided by the manufacturers.\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div class="accordion-group">\r\n            <div class="accordion-heading">\r\n                <a class="accordion-toggle" data-toggle="collapse" data-parent="#accordion2" href="#collapseWhy">Why is my favorite bike company or model not included?\r\n                </a>\r\n            </div>\r\n            <div id="collapseWhy" class="accordion-body collapse">\r\n                <div class="accordion-inner">\r\n                    Up to now I have been the only one putting in data to fill this out.  If you would like a specific manufacturer or model added please <a href="mailto:tribikefit@gmail.com">Email Me</a> with the details for all the available sizes and I will try to add it as quickly as possible.\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div class="accordion-group">\r\n            <div class="accordion-heading">\r\n                <a class="accordion-toggle" data-toggle="collapse" data-parent="#accordion2" href="#collapseCoord">What is the coordinate system?\r\n                </a>\r\n            </div>\r\n            <div id="collapseCoord" class="accordion-body collapse">\r\n                <div class="accordion-inner">\r\n                    The ground plane is the zero in Y direction and the center of the bottom bracket is the zero in the X direction.  All the bikes should have their bottom brackets lined up left to right.\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div class="accordion-group">\r\n            <div class="accordion-heading">\r\n                <a class="accordion-toggle" data-toggle="collapse" data-parent="#accordion2" href="#collapseTerms">What are the definitions of the various terms?\r\n                </a>\r\n            </div>\r\n            <div id="collapseTerms" class="accordion-body collapse">\r\n                <div class="accordion-inner">\r\n                    <dl class="dl-horizontal">\r\n                        <dt>Stack:</dt>\r\n                        <dd>The vertical distance measured from the center of the bottom bracket to the top of the headtube.</dd>\r\n                        <dt>Reach:</dt>\r\n                        <dd>The horizontal distance measured from the center of the bottom bracket to the top of the headtube.</dd>\r\n                        <dt>Front Center:</dt>\r\n                        <dd>The distance measured from the center of the bottom bracket to the center of the front wheel.</dd>\r\n                        <dt>Rear Center:</dt>\r\n                        <dd>The distance measured from the center of the bottom bracket to the center of the rear wheel.</dd>\r\n                        <dt>Head Tube:</dt>\r\n                        <dd>The length of the head tube.</dd>\r\n                    </dl>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n';});


define('text!views/frameAdmin.html',[],function () { return '<section>\r\n    <form class="form-horizontal">\r\n        <div class="control-group">\r\n            <label class="control-label" for="manufacturer">Manufacturer:</label>\r\n            <div class="controls">\r\n                <select class="input-large" id="manufacturer" data-bind="options: manufacturers, optionsText: \'name\', value: manu"></select>\r\n            </div>\r\n        </div>\r\n    </form>\r\n    <p>Manufacturer Is Active: <input type="checkbox" data-bind="checked: manu().isActive" /></p>\r\n    <div class="button-bar">\r\n        <button class="btn btn-info" data-bind="click: createNewModel, enable: canCreateNewModel"><i class="icon-plus"></i> Create New Model</button>\r\n        <button class="btn btn-info" data-bind="click: cancel, enable: canSave"><i class="icon-undo"></i> Cancel</button>\r\n        <button class="btn btn-info" data-bind="click: save, enable: canSave"><i class="icon-save"></i> Save</button>\r\n        <i class="icon-asterisk" data-bind="visible: hasChanges"></i>\r\n    </div>\r\n    <div data-bind="foreach: modelsWithSizes">\r\n        <legend data-bind="text: name"></legend>\r\n        <div class="form-inline">\r\n            <label>Model Name:</label>\r\n            <input class="input-medium" data-bind="value: name" placeholder="Model Name" />\r\n            <label>Release Date:</label>\r\n            <input class="input-small" data-bind="value: manufacturedStartDateFormatted" />\r\n            <label>End Date:</label>\r\n            <input class="input-small" data-bind="value: manufacturedEndDateFormatted" />\r\n            <button class="btn btn-info" data-bind="click: addNewSize"><i class="icon-plus"></i> Add New Size</button>\r\n        </div>\r\n        <table class="table table-striped table-bordered table-condensed">\r\n            <thead>\r\n                <tr>\r\n                    <th>Size</th>\r\n                    <th>Sort Order</th>\r\n                    <th>Stack</th>\r\n                    <th>Reach</th>\r\n                    <th>BB Drop</th>\r\n                    <th>Head Tube Length</th>\r\n                    <th>Head Tube Angle</th>\r\n                    <th>Front Center</th>\r\n                    <th>Rear Center</th>\r\n                    <th>Min. Seat Angle</th>\r\n                    <th>Max. Seat Angle</th>\r\n                    <th>Wheel Size</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody data-bind="foreach: sizes">\r\n                <tr>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: size" placeholder="Size" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: sortOrder" placeholder="Sort Order" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: stack" placeholder="Stack" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: reach" placeholder="Reach" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: bottomBracketDrop" placeholder="Reach" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: headTubeLength" placeholder="Head Tube Length" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: headTubeAngle" placeholder="Head Tube Angle" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: frontCenter" placeholder="Front Center" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: rearCenter" placeholder="Rear Center" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: minSeatAngle" placeholder="Min. Seat Angle" />\r\n                    </td>\r\n                    <td>\r\n                        <input class="input-small" data-bind="value: maxSeatAngle" placeholder="Max. Seat Angle" />\r\n                    </td>\r\n                    <td>\r\n                        <select class="input-small" data-bind="options: $parents[1].wheelSizes(), optionsText: \'name\', optionsValue: \'value\', value: wheelSize"></select>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n    </div>\r\n</section>\r\n';});


define('text!views/frameSelection.html',[],function () { return '\r\n    <h3 class="text-center" data-bind="text: name, style: { color: color }"></h3>\r\n    <form class="form-horizontal">\r\n        <div class="control-group">\r\n            <label class="control-label" for="manufacturer">Manufacturer:</label>\r\n            <div class="controls">\r\n                <select class="input-medium" id="manufacturer" data-bind="options: $parent.manufacturers, optionsText: \'name\', value: manufacturer"></select>\r\n            </div>\r\n        </div>\r\n        <div class="control-group">\r\n            <label class="control-label" for="model">Model:</label>\r\n            <div class="controls">\r\n                <select class="input-medium" id="model" data-bind="options: models, optionsText: \'name\', value: model"></select>\r\n            </div>\r\n        </div>\r\n        <div class="control-group">\r\n            <label class="control-label" for="size">Size:</label>\r\n            <div class="controls">\r\n                <select class="input-medium" id="size" data-bind="options: sizes, optionsText: \'size\', value: size"></select>\r\n            </div>\r\n        </div>\r\n        <div data-bind="with: size">\r\n            <h3 class="text-center">Geometry</h3>\r\n            <dl class="dl-horizontal">\r\n                <dt>Stack:</dt>\r\n                <dd data-bind="text: stackFormatted"></dd>\r\n                <dt>Reach:</dt>\r\n                <dd data-bind="text: reachFormatted"></dd>\r\n                <dt>Front Center:</dt>\r\n                <dd data-bind="text: frontCenterFormatted"></dd>\r\n                <dt>Rear Center:</dt>\r\n                <dd data-bind="text: rearCenterFormatted"></dd>\r\n                <dt>Head Tube:</dt>\r\n                <dd data-bind="text: headTubeLengthFormatted"></dd>\r\n                <dt>Min Seat Angle:</dt>\r\n                <dd data-bind="text: minSeatAngleFormatted"></dd>\r\n                <dt>Min Seat Angle:</dt>\r\n                <dd data-bind="text: maxSeatAngleFormatted"></dd>\r\n                <dt>Wheel Size:</dt>\r\n                <dd data-bind="text: wheelSizeFormatted"></dd>\r\n            </dl>\r\n        </div>\r\n    </form>\r\n';});


